LMC-3000 is a modern low-speed bench-top centrifuge designed for operation with microtest plates and centrifuge tubes up to 50 ml. This device is widely used in biomedical profile laboratories.

Features:

• Soft start and run-down of the rotor;
• User-friendly setting of centrifugation parameters 
   (speed and time) and simultaneous display of both 
   set and actual values;
• Safe operation at any speed is provided by metal 
   protection chamber and case cover, automatic stop 
   at imbalance and a lock keeping the lid closed while 
   the centrifuge is running;
• Low noise level;
• Wide choice of accessory rotors
